<section class="gridx1">
<h2>Aide</h2>
<p>Le plugin "Espace Privée" permet de rendre tout ou partie de votre site accessible uniquement à des utilisateurs bénificiant d'un accés V.I.P..</p>

<p>A l'activation, un nouveau profil apparait pour vos utilisateurs. Vous pouvez ajouter un utilisateur qui aura accés aux zones privatisés sans avoir de droits pour accéder à la partie administration de votre site.</p>
<p>La seule page de l'administration qui lui sera accéssible sera la page d'authenfication</p>

<h3>Prérequis</h3>
<p><strong>Comme tout les plugins, dés l'activation il vous faut configurer votre plugin de façon à ce qu'il fonctionne entierement.</strong></p>
<p>Le plugin à la premiere configuration va faire un backup de votre fichier utilisateurs <small>(user.xml => user.xml.back)</small> et crèer un fichier CSV <small>(username.csv dans le dossier du plugin)</small> avec ses entêtes, celui-ci vous permettra d'ajouter par lot des utilisateur VIP.<small>Voir plus bas pour le detail</small> </p>
<h3>Configuration</h3>
<p>Le plugin vous permet de choisir entre plusieurs configuration d'espaces V.I.P., Vous pouvez opter pour rendre privé:</p>
<ol>
  <li> l'espace <b>Blog</b>, si votre page d'acceuil est une page statique <b><small> sinon c'est votre page d'acceuil! ;) </small></b>,</li>
  <li> les pages <b>Catégories et Articles</b> ,</li>
  <li> les pages <b>Statiques</b> </li>
  <li>ou désactiver tout les espaces privée en selectionnant <b>Aucune</b> <small>(valeur par défaut à l'activation du plugin)</li>
</ol></small>.</p>

<h3>Traitement par lot de nouveaux V.I.P.</h3>
<p>Le traitement par lot s'effectue sur la structure d'un fichier au format CSV, ce type de fichier peut-être ouvert et editer avec de nombreux editeurs de texte ou de feuille de calcul. Les 2 programmes plus connus du grand publics sont Excel(MS) et OpenOffice calc.</p>
<p class="gridx2">Vous pouvez, soit télecharger le fichier du plugin et l'editer dans votre programme favori en ajoutant vos utilisateurs ligne par ligne en respectant les colonnes :<img src="data:image/jpg;base64," alt="feuille de calcul">
  ou directement dans l'éditeur du plugin
  <img src="data:image/jpg;base64,"> <strong>en respectant la syntaxe et un enregistrement par ligne.</strong>
</p>
<h3>résumé et info à propos de l'édition <i>'Ajout utilisateurs'</i></h3>
<ol>
  <li>Conservez les entêtes de la premiere ligne,<code>Login;Name;Password;Email</code> cette ligne n'est pas enregistrée comme Utilisateur mais vous rapelle la syntaxe à respecter. </li>
  <li>Il y a quatre champs séparés par un point virgule, ces champs vont créer les utilisateurs avec leur adresse mail et mot de passe respectif .</li>
  <li> Le mot de passe sera crypté à l'enregistrement, si il est perdu par l'utilisateur et selon la configuration native de votre PluXml, son adresse mail <small>si valide</small> pourra lui servir à en créer un nouveau.</li>
  <li>L'enregistrement ne gére pas les doublons, mais ne finalisera pas un traitement en lot si une ligne est incompléte ou comporte une erreur de syntaxe</li>
  <li>Lorsque vous désactiver le Plugin, tous vos utilisateurs V.I.P.,  n'ayant plus d'accés privé réservé,   voient leur compte désactivé afin de ne plus apparaitre dans la partie 'Comptes Utilisateurs' de l'administration. </li>
  <li>Lorsque vous activer le Plugin, tous les comptes V.I.P. déjà enregistrés seront réactiver</li>
  <li>Pour effacer ou modifier un Utilisateur, cela se passe par la page 'Comptes Utilisateurs' de l'administration.</li>
</ol>
</section>